import React from "react";
import { Box, Text } from "@chakra-ui/core";

const AboutB = () => {
  return (
    <Box>
      <Text
        color="#5863F8"
        fontWeight={700}
        fontSize="14px"
        textTransform="uppercase"
      >
        About us
      </Text>
    </Box>
  );
};

export default AboutB;
